import React from 'react'
import classes from './list.module.css';

const List = () => {
  return (
    <div className={classes.list__list}>
      <div className={classes.list__item}>
        <ul>
          <li>Hello</li>
        </ul>
      </div>
    </div>
  )
}

export default List
